import React from "react";
import { Col, Container, Form, Row } from "react-bootstrap";

const Contact = () => {
  return (
    <div id="Contact">
      <div className="box">
        <Container>
          <Row>
            <Col className="border">
              <h2>mail me</h2>
              <Form>
              <Form.Label>name:
              </Form.Label>
              </Form>
            </Col>
            <Col className="border"></Col>
          </Row>
        </Container>
      </div>
    </div>
  );
};

export default Contact;
